import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";

function Home() {
  const navigate = useNavigate();
  const [selected, setSelected] = useState(0);
  return (
    <MainContainer>
      <Nav>
        <Logo>TABI</Logo>
        <NavRight>
          <NavRightBtn
            onClick={() => {
              navigate("/log-in");
            }}
          >
            Log In
          </NavRightBtn>
          <NavRightBtn
            onClick={() => {
              navigate("/sign-up");
            }}
          >
            Sign Up
          </NavRightBtn>
        </NavRight>
      </Nav>
      <NavBottom>
        <NavBottomBtn
          selected={selected === 0 ? "true" : "false"}
          onClick={() => {
            setSelected(0);
          }}
        >
          Home
        </NavBottomBtn>
        <NavBottomBtn
          selected={selected === 1 ? "true" : "false"}
          onClick={() => {
            setSelected(1);
          }}
        >
          Suzume
        </NavBottomBtn>
        <NavBottomBtn
          selected={selected === 2 ? "true" : "false"}
          onClick={() => {
            setSelected(2);
          }}
        >
          FAQ
        </NavBottomBtn>
      </NavBottom>
      <TabiMap>TABI MAP</TabiMap>
      <Container>
        <Title>여행 코스추천</Title>
      </Container>
    </MainContainer>
  );
}

export default Home;
const MainContainer = styled.div`
  width: 100vw;
  display: flex;
  flex-direction: column;
`;
const Nav = styled.div`
  width: 100vw;
  display: flex;
  align-items: flex-start;
  justify-content: space-between;
  padding-top: 30px;
`;
const Logo = styled.p`
  font-size: 45px;
  font-weight: 700;
  margin-left: 30px;
`;
const NavRight = styled.div`
  display: flex;
  align-items: center;
  gap: 30px;
  margin-right: 30px;
`;
const NavRightBtn = styled.p`
  cursor: pointer;
  cursor: pointer;
  font-size: 18px;
`;
const NavBottom = styled.div`
  margin-top: 25px;
  display: flex;
  align-items: center;
  gap: 30px;
  margin-left: 30px;
`;
const NavBottomBtn = styled.p`
  cursor: pointer;
  font-size: 28px;
  border-bottom: ${(props) =>
    props.selected === "true" ? "2px solid #000" : "none"};
  opacity: ${(props) => (props.selected === "true" ? 1 : 0.5)};
`;
const TabiMap = styled.div`
  margin-top: 30px;
  margin-left: 30px;
  margin-right: 30px;
  width: calc(100vw - 60px);
  height: 400px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 30px;
  background: #d0d0d0;
  border-radius: 10px;
  margin-bottom: 30px;
`;
const Container = styled.div`
  margin-left: 30px;
  margin-right: 30px;
  width: calc(100vw - 60px);
  display: flex;
  flex-direction: column;
  align-items: flex-start;
`;
const Title = styled.p`
  font-size: 25px;
`;
